import React from "react";
import styles from "./WatchContent.module.css";

const WatchContent = () => {
  const videoslider = (links) => {
    document.querySelector(".slider").src = links;
  };
  return (
    <div class="container">
      {/* <DocumentMeta {...meta} /> */}
      <video
        src="./vid-1.mp4"
        class="slider"
        autoplay
        loop
        muted
        controls
      ></video>

      {/* Video slider ka links in an unordered list (below) */}
      <ul>
        <li onclick="videoslider('vid-1.mp4')">
          <video width="320" height="240" controls>
            <source src="./vid-1.mp4" type="video/mp4" />
          </video>
        </li>
        <li onclick="videoslider('vid-2.mp4')">
          <video width="320" height="240" controls>
            <source src="./vid-2.mp4" type="video/mp4" />
          </video>
        </li>
        <li onclick="videoslider('vid-3.mp4')">
          <video width="320" height="240" controls>
            <source src="./vid-3.mp4" type="video/mp4" />
          </video>
        </li>
        <li onclick="videoslider('vid-4.mp4')">
          <video width="320" height="240" controls>
            <source src="./vid-4.mp4" type="video/mp4" />
          </video>
        </li>
        <li onclick="videoslider('vid-5.mp4')">
          <video width="320" height="240" controls>
            <source src="./vid-5.mp4" type="video/mp4" /></video>
        </li>
      </ul>
    </div>
  );
};

export default WatchContent;
